      | 365916 -> { ItemTypeData.id= 365916; name= "Active Omega-Booster (3-Day)"; published= false; description= "Boosters are biomechanical grafts designed to stimulate nerve growth and neurotransmitter activity, temporarily increasing cognitive processes. The graft will degrade over time until it is completely absorbed by the body and ceases to function.    Active Boosters add a percentage bonus to the number of skill points earned at the end of each battle. They do not increase the number of skill points remaining in the active skill point pool."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
